INSERT INTO `catalog_product_entity_text` VALUES (1,4,150,0,1,'15'),(2,4,151,0,1,'Brillante colore giallo dorato, con riflessi leggermente verdognoli'),(3,4,152,0,1,'Profumi di crosta di pane e frutta secca, sfumature di nocciole e fichi secchi'),(4,4,153,0,1,'Sapore fresco e sapido, con leggera nota agrumata di pompelmo. Grande corpo'),(5,4,154,0,1,'Franciacorta D.O.C.G. Brut'),(6,4,155,0,1,'750 ml'),(7,4,156,0,1,'90% Chardonnay – 10% Pinot Nero'),(8,4,157,0,1,'Vigneti posti sulle dolci colline di Adro (BS). Posizione particolarmente esposta e ventilata, suolo ciottoloso, moderatamente calcareo ed ottimamente drenante.'),(9,4,162,0,1,NULL),(10,4,163,0,1,NULL),(11,4,164,0,1,NULL),(12,4,158,0,1,'20 anni'),(13,4,165,0,1,NULL),(14,4,166,0,1,NULL),(15,4,167,0,1,NULL),(16,4,168,0,1,NULL),(17,4,159,0,1,'Fine Agosto, inizio di Settembre. Le uve sono raccolte a mano, trasportate e lavorate lo stesso giorno'),(18,4,160,0,1,'Pressatura soffice\r\nDecantazione statica a freddo\r\nInoculo con lieviti selezionati\r\nFermentazione di 20 gg in acciaio inox AISI 316\r\nFermentazione malolattica svolta parzialmente\r\n'),(19,4,161,0,1,'12,5% vol.'),(20,4,169,0,1,NULL),(21,4,170,0,1,NULL),(22,4,171,0,1,NULL),(23,4,172,0,1,NULL),(24,4,173,0,1,NULL),(25,4,74,0,1,'<em>Noble Cuvée</em> Selezione Grand Vintage Franciacorta D.O.C.G\r\n'),(26,4,73,0,1,'Nasce dai nostri vigneti Grand Cru coltivati ad uva Chardonnay e Pinot Nero. Dopo i 7 mesi per la prima fermentazione in piccole vasche di acciaio, per 30 mesi circa, riposa, matura e si affina rifermentando in bottiglia, a contatto con i lieviti selezionati, nell’oscurità e nel silenzio della Cantina.'),(27,4,149,0,1,'<strong>Eleganza del gusto&nbsp;ca&rsquo; d&rsquo;or</strong>\r\n<p>Un Brut Franciacorta dai profumi e sapori complessi, ma dotato di un perfetto equilibrio che lo rende la perfetta esperienza sensoriale per tutti. Un gusto deciso dovuto anche alla sua prolungata permanenza sui lieviti, solitamente pi&ugrave; del doppio rispetto al disciplinare del Franciacorta, al fine di ottenere un prodotto originale, intrigante e con fragranze variegate.</p>\r\n<p>La nostra Noble Cuv&egrave;e ritrae l&rsquo;eleganza del gusto Ca&rsquo; d&rsquo;Or. E&rsquo; di un brillante colore giallo dorato, con riflessi leggermente verdognoli. Viene lavorato in purezza ed esprime al naso profumi di crosta di pane e frutta secca, sfumature di nocciole e fichi secchi. Al palato, invece, un fresco e sapido sapore, con una leggera nota agrumata di pompelmo, si sposa con armonia ad un grande corpo.</p>\r\n<p>La bollicina &egrave; molto fine e di raffinata eleganza. Il finale &egrave; lungo e di perfetto equilibrio.</p>'),(28,4,141,0,1,NULL),(29,4,84,0,1,NULL),(30,4,135,0,1,NULL),(31,4,107,0,1,NULL),(32,4,150,0,2,'15'),(33,4,151,0,2,'Brillante colore giallo dorato, con riflessi leggermente verdognoli'),(34,4,152,0,2,'Profumi di crosta di pane e frutta secca, sfumature di nocciole e fichi secchi'),(35,4,153,0,2,'Sapore fresco e sapido, con leggera nota agrumata di pompelmo. Grande corpo'),(36,4,154,0,2,'Franciacorta D.O.C.G. Brut'),(37,4,155,0,2,'1500 ml'),(38,4,156,0,2,'90% Chardonnay – 10% Pinot Nero'),(39,4,157,0,2,'Vigneti posti sulle dolci colline di Adro (BS). Posizione particolarmente esposta e ventilata, suolo ciottoloso, moderatamente calcareo ed ottimamente drenante.'),(40,4,162,0,2,NULL),(41,4,163,0,2,NULL),(42,4,164,0,2,NULL),(43,4,158,0,2,'20 anni'),(44,4,165,0,2,NULL),(45,4,166,0,2,NULL),(46,4,167,0,2,NULL),(47,4,168,0,2,NULL),(48,4,159,0,2,'Fine Agosto, inizio di Settembre. Le uve sono raccolte a mano, trasportate e lavorate lo stesso giorno'),(49,4,160,0,2,'Pressatura soffice\r\nDecantazione statica a freddo\r\nInoculo con lieviti selezionati\r\nFermentazione di 20 gg in acciaio inox AISI 316\r\nFermentazione malolattica svolta parzialmente\r\n'),(50,4,161,0,2,'12,5% vol.'),(51,4,169,0,2,NULL),(52,4,170,0,2,NULL),(53,4,171,0,2,NULL),(54,4,172,0,2,NULL),(55,4,173,0,2,NULL),(56,4,74,0,2,'<em>Noble Cuvée</em> Selezione Grand Vintage Franciacorta D.O.C.G\r\n'),(57,4,73,0,2,'Nasce dai nostri vigneti Grand Cru coltivati ad uva Chardonnay e Pinot Nero. Dopo i 7 mesi per la prima fermentazione in piccole vasche di acciaio, per 30 mesi circa, riposa, matura e si affina rifermentando in bottiglia, a contatto con i lieviti selezionati, nell’oscurità e nel silenzio della Cantina.'),(58,4,149,0,2,'<strong>Eleganza del gusto&nbsp;ca&rsquo; d&rsquo;or</strong>\r\n<p>Un Brut Franciacorta dai profumi e sapori complessi, ma dotato di un perfetto equilibrio che lo rende la perfetta esperienza sensoriale per tutti. Un gusto deciso dovuto anche alla sua prolungata permanenza sui lieviti, solitamente pi&ugrave; del doppio rispetto al disciplinare del Franciacorta, al fine di ottenere un prodotto originale, intrigante e con fragranze variegate.</p>\r\n<p>La nostra Noble Cuv&egrave;e ritrae l&rsquo;eleganza del gusto Ca&rsquo; d&rsquo;Or. E&rsquo; di un brillante colore giallo dorato, con riflessi leggermente verdognoli. Viene lavorato in purezza ed esprime al naso profumi di crosta di pane e frutta secca, sfumature di nocciole e fichi secchi. Al palato, invece, un fresco e sapido sapore, con una leggera nota agrumata di pompelmo, si sposa con armonia ad un grande corpo.</p>\r\n<p>La bollicina &egrave; molto fine e di raffinata eleganza. Il finale &egrave; lungo e di perfetto equilibrio.</p>'),(59,4,141,0,2,NULL),(60,4,84,0,2,NULL),(61,4,135,0,2,NULL),(62,4,107,0,2,NULL),(63,4,150,0,3,'14'),(64,4,151,0,3,'intenso colore giallo dorato, con riflessi ramati'),(65,4,152,0,3,'Profumi intensi e complessi, con note originali di tabacco verde, di noce e richiami di ribes nero'),(66,4,153,0,3,'Elegante ed armonico. Grande corpo, struttura e sapidità'),(67,4,154,0,3,'Franciacorta D.O.C.G. Pas Dosé Riserva'),(68,4,155,0,3,'750 ml'),(69,4,156,0,3,'55% Chardonnay, 45% Pinot Nero'),(70,4,157,0,3,'Piccola porzione di vigneto, con posizione particolarmente esposta e ventilata, suolo ciottoloso, moderatamen