e; molto fine e di raffinata eleganza. Il finale &egrave; lungo, forte e di perfetto equilibrio.</p>'),(90,4,141,0,3,NULL),(91,4,84,0,3,NULL),(92,4,135,0,3,NULL),(93,4,107,0,3,NULL),(94,4,150,0,4,NULL),(95,4,151,0,4,'Antico colore rosa quarzo, con riflessi aranciati'),(96,4,152,0,4,'Profumi complessi, molto intensi, con chiare note di piccoli frutti rossi, frutta tropicale e petali di rosa'),(97,4,153,0,4,'Fresco, complesso, armonico, con note sapide ed acidule, guidate da una nota di frutti rossi.\r\nBuon corpo.\r\n'),(98,4,154,0,4,'Franciacorta D.O.C.G. Brut Rosé'),(99,4,155,0,4,'750 ml'),(100,4,156,0,4,'80% Pinot Nero – 20% Chardonnay'),(101,4,157,0,4,'Vigneti posti sulle dolci colline di Passirano (BS). Posizione particolarmente esposta e ventilata, suolo ciottoloso, moderatamente calcareo ed ottimamente drenante.'),(102,4,162,0,4,NULL),(103,4,163,0,4,NULL),(104,4,164,0,4,NULL),(105,4,158,0,4,'20 anni'),(106,4,165,0,4,NULL),(107,4,166,0,4,NULL),(108,4,167,0,4,NULL),(109,4,168,0,4,NULL),(110,4,159,0,4,'Fine Agosto, inizio di Settembre. Le uve sono raccolte a mano, trasportate e lavorate lo stesso giorno'),(111,4,160,0,4,'Pressatura soffice previa macerazione di circa 3-4 ore a freddo (17/18°C)\r\nDecantazione statica a freddo\r\nInoculo con lieviti selezionati\r\nFermentazione di 20 gg in acciaio inox AISI 316\r\nFermentazione malolattica svolta parzialmente\r\n'),(112,4,161,0,4,'12,5% vol.'),(113,4,169,0,4,NULL),(114,4,170,0,4,NULL),(115,4,171,0,4,NULL),(116,4,172,0,4,NULL),(117,4,173,0,4,NULL),(118,4,74,0,4,'<em>Noble Rosé</em> Selezione Grand Vintage Franciacorta D.O.C.G'),(119,4,73,0,4,'Nasce dai nostri vigneti Grand Cru coltivati ad uva Pinot Nero e Chardonnay sulle dolci colline di Passirano. Dopo i 7 mesi per la prima fermentazione in piccole vasche di acciaio, per 30 mesi circa, riposa, matura e si affina rifermentando in bottiglia, a contatto con i lieviti selezionati, nell’oscurità e nel silenzio della Cantina.'),(120,4,149,0,4,'<strong>Il binomio goloso e seducente del gusto ca’ d’or</strong>\r\n<p>Un magico e romantico Franciacorta, in equilibrio tra delicatezza delle uve Chardonnay e la forza, la robustezza e la complessità delle uve Pinot Nero.</p>\r\n<p>Il nostro Noble Rosé, immagine del binomio goloso e seducente di Ca’ d’Or, è di un antico color rosa quarzo, con riflessi aranciati, dato dal perfetto tempo di lavorazione, ovvero pochissime ore di macerazione a freddo delle uve Pinot Nero. Viene lavorato in purezza, ed esprime al naso profumi complessi, molto intensi, con chiare note di piccoli frutti rossi, frutta tropicale e di petali di rosa. Al palato, il fresco ed ampio sapore, unito ad un buon corpo, diviene armonia, tra note sapide e acidule, guidate da una nota golosa di frutti rossi.</p>\r\n<p>La bollicina è molto fine e di raffinata eleganza, il finale è di buon equilibrio.</p>\r\n'),(121,4,141,0,4,NULL),(122,4,84,0,4,NULL),(123,4,135,0,4,NULL),(124,4,107,0,4,NULL),(125,4,133,0,1,NULL),(144,4,150,0,5,NULL),(145,4,151,0,5,'Antico colore rosa quarzo, con riflessi aranciati'),(146,4,152,0,5,'Profumi complessi, molto intensi, con chiare note di piccoli frutti rossi, frutta tropicale e petali di rosa'),(147,4,153,0,5,'Fresco, complesso, armonico, con note sapide ed acidule, guidate da una nota di frutti rossi.\r\nBuon corpo.\r\n'),(148,4,154,0,5,'Franciacorta D.O.C.G. Brut Rosé'),(149,4,155,0,5,'1500 ml'),(150,4,156,0,5,'80% Pinot Nero – 20% Chardonnay'),(151,4,157,0,5,'Vigneti posti sulle dolci colline di Passirano (BS). Posizione particolarmente esposta e ventilata, suolo ciottoloso, moderatamente calcareo ed ottimamente drenante.'),(152,4,162,0,5,NULL),(153,4,163,0,5,NULL),(154,4,164,0,5,NULL),(155,4,158,0,5,'20 anni'),(156,4,165,0,5,NULL),(157,4,166,0,5,NULL),(158,4,167,0,5,NULL),(159,4,168,0,5,NULL),(160,4,159,0,5,'Fine Agosto, inizio di Settembre. Le uve sono raccolte a mano, trasportate e lavorate lo stesso giorno'),(161,4,160,0,5,'Pressatura soffice previa macerazione di circa 3-4 ore a freddo (1