sashimi'),(444,4,172,0,9,'10-12°C'),(445,4,173,0,9,'12-18 mesi'),(446,4,74,0,9,'Soave Classico Ca’d’Or D.O.C. Selezione I Classici\r\n'),(447,4,73,0,9,'Il Soave Classico Ca’ d’Or è una ouverture perfetta di una calda serata di primavera che sfuma nella freschezza arborea delle sue note bucoliche.'),(448,4,149,0,9,'<strong>La fragranza di ca’ d’or</strong>\r\n<p>Delicatamente minerale e sapido il Soave Ca’ d’Or è un vino ideale per aperitivi a base di crostacei e pesce crudo. Le nuances esotiche lo rendono ideale compagno per sushi e sashimi. Fresco e di buona struttura all’olfatto arriva intensa la fragranza di agrumi e frutti a polpa gialla.</p>\r\n'),(449,4,141,0,9,NULL),(450,4,84,0,9,NULL),(451,4,135,0,9,NULL),(452,4,107,0,9,NULL),(453,4,150,0,10,'9'),(454,4,151,0,10,'giallo paglierino intenso'),(455,4,152,0,10,'incalzante e inebriante profumo di pera, lampone, ananas, banana, albicocca, pesca e mela. Di erbe di campo, camomilla e the verde'),(456,4,153,0,10,'fruttato, diretto e ricco di struttura ed avvolgente morbidezza. Molto persistente. Sapido e fresco. Delicatamente salino'),(457,4,154,0,10,'Pinot Grigio delle Venezie Ca’ d’Or I.G.T.'),(458,4,155,0,10,'750 ml'),(459,4,156,0,10,NULL),(460,4,157,0,10,NULL),(461,4,162,0,10,'100% Pinot Grigio'),(462,4,163,0,10,'10 Ha, a cordone speronato e guyot coltivati a Roncà su suoli vulcanici'),(463,4,164,0,10,'compresa tra 150 e 250 m/slm'),(464,4,158,0,10,'15 anni'),(465,4,165,0,10,'5.000'),(466,4,166,0,10,'6/7.000 Lt/Ha'),(467,4,167,0,10,'30.000'),(468,4,168,0,10,'inizia a fine Agosto. Le uve sono raccolte a mano, trasportate e lavorate lo stesso giorno.'),(469,4,159,0,10,NULL),(470,4,160,0,10,NULL),(471,4,161,0,10,NULL),(472,4,169,0,10,'in contenitori di acciaio (50%) ed in botti di rovere (50%)'),(473,4,170,0,10,'negli stessi contenitori fino alla primavera successiva'),(474,4,171,0,10,'ideale con piatti di pesce di mare e primi piatti a base vegetale'),(475,4,172,0,10,'12°C'),(476,4,173,0,10,'30 mesi'),(477,4,74,0,10,'Pinot Grigio delle Venezie Ca’ d’Or I.G.T. Selezione I Classici\r\n'),(478,4,73,0,10,'Il Pinot Grigio delle Venezie Ca’ d’Or inebriante nettare dall’incalzante profumo di pera, ananas e pesca. Fruttato e avvolgente risulta un vino dalla fortissima personalità.'),(479,4,149,0,10,'<strong>La freschezza di ca’ d’or</strong>\r\n<p>Il gusto morbido e persistente fa da colonna sonora a una pausa elegante e briosa allo stesso tempo. </p>\r\n<p>Sapido e fresco al palato è un perfetto abbinamento per piatti a base di pesce e verdure.</p>\r\n'),(480,4,141,0,10,NULL),(481,4,84,0,10,NULL),(482,4,135,0,10,NULL),(483,4,107,0,10,NULL),(484,4,150,0,11,'9'),(485,4,151,0,11,'Rosso rubino'),(486,4,152,0,11,'Ciliegia e piccoli frutti di bosco a bacca rossa'),(487,4,153,0,11,'Fresche note di piccoli frutti di bosco a bacca rossa. Tannino delicato ed equilibrato'),(488,4,154,0,11,'Valpolicella Ca’d’Or'),(489,4,155,0,11,'750 ml'),(490,4,156,0,11,NULL),(491,4,157,0,11,NULL),(492,4,162,0,11,'65% Corvina, 15% Corvinone + 10% Rondinella + 10% altri vitigni'),(493,4,163,0,11,'12 Ha, in località Bastia, sullo spartiacque tra la Val d’Alpone e la Val d’Illasi. I terreni, disposti in forma di ampio pianoro, con lievi pendenze, sono argilloso-marnosi sub-alcalini, prodotti dall’alterazione di formazioni calcareo-fossilifere, in particolare la scaglia rossa ed il biancone\r\n'),(494,4,164,0,11,'450 m/slm'),(495,4,158,0,11,'Nuovi ed impianti esistenti da 20 a 35 anni'),(496,4,165,0,11,'5.200'),(497,4,166,0,11,'60 – 70 Hl/Ha'),(498,4,167,0,11,NULL),(499,4,168,0,11,'Ultime due settimane di Settembre, a mano'),(500,4,159,0,11,NULL),(501,4,160,0,11,NULL),(502,4,161,0,11,NULL),(503,4,169,0,11,'In vasche d’acciaio e botti'),(504,4,170,0,11,'In vasche d’acciaio e botti'),(505,4,171,0,11,'ideale con piatti di pesce di mare e primi piatti a base vegetale'),(506,4,172,0,11,'14 – 16°C'),(507,4,173,0,11,NULL),(508,4,74,0,11,'Valpolicella Ca’d’Or Selezione I Classici\r\n'),(509,4,73,0,11,'Il Valpollicella Ca’ d’Or sprigiona profumi delicati che ricordano le mandorle e la viola. Al palato riserva un gusto asciutto, morbido e di buona struttura.'),(510,4,149,0,11,'<strong>L’armonia di ca’ d’or</strong>\r\n<p>Armonioso e complesso che sorprende al naso per il suo profumo intenso e persistente. Il risultato è un vino rosso rubino, dal carattere forte e deciso, dal profumo intenso ed etereo e dal gusto rotondo e vellutato.</p>\r\n'),(511,4,141,0,11,NULL),(512,4,84,0,11,NULL),(513,4,135,0,11,NULL),(514,4,107,0,11,NULL),(515,4,150,0,12,'9'),(516,4,151,0,12,'Rosso rubino'),(517,4,152,0,12,'Piccoli frutti di bosco a bacca rossa'),(518,4,153,0,12,'Fresche note di piccoli frutti di bosco a bacca rossa. Tannino delicato ed equilibrato'),(519,4,154,0,12,'Valpolicella Ripasso Superiore Ca D’Or'),(520,4,155,0,12,'750 ml'),(521,4,156,0,12,NULL),(522,4,157,0,12,NULL),(523,4,162,0,12,'65% Corvina, 15% Corvinone + 10% Rondinella + 10% altri vitigni'),(524,4,163,0,12,'12 Ha in località Bastia, esattamente sullo spartiacque tra la Val d’Alpone e la Val d’Illasi. I terreni, argilloso-marnosi subalcalini, prodotti dall’alterazione di formazioni calcaree di origine fossilifera, in particolare la scaglia rossa ed il biancone'),(525,4,164,0,12,'450 m/slm'),(526,4,158,0,12,'Nuovi ed impianti esistenti da 20 a 35 anni'),(527,4,165,0,12,'5.200'),(528,4,166,0,12,'60 – 70 Hl/Ha'),(529,4,167,0,12,NULL),(530,4,168,0,12,'Ultime due settimane di Settembre, a mano'),(531,4,159,0,12,NULL),(532,4,160,0,12,NULL),(533,4,161,0,12,NULL),(534,4,169,0,12,'Il Ripasso è una tecnica tradizionale di vinificazione che prevede una rimacerazione del vino Valpolicella sulle vinacce dell’Amarone appena svinato. '),(535,4,170,0,12,'Maturazione in rovere da 500/1000 lt per 18 mesi'),(536,4,171,0,12,NULL),(537,4,172,0,12,'16 – 18°C'),(538,4,173,0,12,NULL),(539,4,74,0,12,'Valpolicella Ripasso Superiore Ca D’Or Selezione Noble\r\n'),(540,4,73,0,12,'Il Ripasso della Valpollicella Ca’ d’Or maturato in rovere da 500/1000 lt per 18 mesi è un vino che si distingue per la particolare morbidezza e le note dolci e fruttate nascono da un sapiente blend.'),(541,4,149,0,12,'<strong>La tradizione di Ca’d’Or</strong>\r\n<p>La morbidezza e la rotondità esaltano la componente tipica di tutta la gamma dei frutti a bacca rossa come la ciliegia e il ribes.</p>\r\n'),(542,4,141,0,12,NULL),(543,4,84,0,12,NULL),(544,4,135,0,12,NULL),(545,4,107,0,12,NULL),(546,4,150,0,13,'9'),(547,4,151,0,13,'Rosso rubino intenso'),(548,4,152,0,13,'Frutti maturi a bacca rossa, frutti di bosco a bacca piccola'),(549,4,153,0,13,'Opulente e di raffinata eleganza'),(550,4,154,0,13,'Amarone Nerofosco Ca D’Or'),(551,4,155,0,13,'750 ml'),(552,4,156,0,13,NULL),(553,4,157,0,13,NULL),(554,4,162,0,13,'65% Corvina, 15% Corvinone + 10% Rondinella + 10% altri vitigni'),(555,4,163,0,13,'12 Ha, in località Bastia, sullo spartiacque tra la Val d’Alpone e la Val d’Illasi. I terreni, disposti in forma di ampio pianoro, con lievi pendenze, sono argilloso-marnosi sub-alcalini, prodotti dall’alterazione di formazioni calcareo-fossilifere, in particolare la scaglia rossa ed il biancone. La presenza del Vulcano (basalti) è inesistente'),(556,4,164,0,13,'450 m/slm'),(557,4,158,0,13,'Nuovi ed impianti esistenti da 20 a 35 anni'),(558,4,165,0,13,'5.200'),(559,4,166,0,13,'60 – 70 Hl/Ha'),(560,4,167,0,13,NULL),(561,4,168,0,13,'Ultime due settimane di Settembre. Le uve sono raccolte a mano e poste a riposo in fruttaio'),(562,4,159,0,13,NULL),(563,4,160,0,13,NULL),(564,4,161,0,13,NULL),(565,4,169,0,13,'Le uve vengono lasciate ad appassire in stanze ben areate per 4-5 mesi affinchè colore, sapore e dolcezza si concentrino al meglio. In inverno le uve vengono pigiate e la fermentazione inizia grazie e lieviti naturali. Successivamente, il mosto viene travasato in botti di legno di 500-1000 lt dove finirà la fermentazione.'),(566,4,170,0,13,'Il vino matura quindi in legno per 30-36 mesi prima di essere imbottigliato.'),(567,4,171,0,13,NULL),(568,4,172,0,13,'18°C'),(569,4,173,0,13,NULL),(570,4,74,0,13,'Amarone Nerofosco Ca D’Or Selezione Noble\r\n'),(571,4,73,0,13,'L’Amarone Ca’ d’Or è un vino senza tempo. Maturato in legno per 30-36 mesi nasce opulento e di raffinata eleganza che infiamma il palato e lo sguardo con i suoi riflessi di rubino intenso.'),(572,4,149,0,13,'<strong>La passione di Ca’d’Or</strong>\r\n<p>Nasce in località Bastia, sullo spartiacque tra la Val d’Alpone e la Val d’Illasi, su terreni disposti in ampio pianoro. Armonia perfetta tra tempo e natura questo Amarone è il frutto dell’eleganza Ca’ d’Or.</p>\r\n'),(573,4,141,0,13,NULL),(574,4,84,0,13,NULL),(575,4,135,0,13,NULL),(576,4,107,0,13,NULL),(577,4,150,0,14,NULL),(578,4,151,0,14,'Colore giallo paglierino dorato, con riflessi leggermente verdognoli'),(579,4,152,0,14,'Profumi e note balsamiche, sensazioni di frutta verde e gialla e nuances esotiche'),(580,4,153,0,14,'Evidente la nota fruttata, agrumata, con nuances balsamiche. Nel finale emerge la mandoria ancora immatura. Buon corpo.'),(581,4,154,0,14,'Metodo Italiano D.O.C. Brut'),(582,4,155,0,14,'750 ml'),(583,4,156,0,14,'70% Durella – 30% Garganega'),(584,4,157,0,14,'Posizione pedemontana particolarmente esposta e ventilata sulle pendici del Monte Calvarina. Suolo vulcanico, moderatamente calcareo ed ottimamente drenante. Altitudine compresa tra i 250 m ed i 450 m slm'),(585,4,162,0,14,NULL),(586,4,163,0,14,NULL),(587,4,164,0,14,NULL),(588,4,158,0,14,'30 anni'),(589,4,165,0,14,NULL),(590,4,166,0,14,NULL),(591,4,167,0,14,NULL),(592,4,168,0,14,NULL),(593,4,159,0,14,'Fine Settembre, inizio di Ottobre. Le uve sono raccolte a mano, trasportate e lavorate lo stesso giorno'),(594,4,160,0,14,'Pressatura soffice\r\nInoculo con lieviti selezionati\r\nFermentazione in piccoli contenitori di acciaio inox AISI 316, in totale assenza di solforosa\r\n'),(595,4,161,0,14,'12% vol.'),(596,4,169,0,14,NULL),(597,4,170,0,14,NULL),(598,4,171,0,14,'Ottimo come aperitivo ed a tutto pasto'),(599,4,172,0,14,NULL),(600,4,17