INSERT INTO `catalogsearch_fulltext` VALUES (123,10,1,'selezione-i-classici-pinot-grigio-delle-venezie-cador-750ml|Taxable Goods|750 ml|Selezione i Classici Pinot Grigio delle Venezie Ca’ d’Or I.G.T. 750 ml|Il Pinot Grigio delle Venezie Ca’ d’Or inebriante nettare dall’incalzante profumo di pera, ananas e pesca. Fruttato e avvolgente risulta un vino dalla fortissima personalità.|Pinot Grigio delle Venezie Ca’ d’Or I.G.T. Selezione I Classici|100|1'),(124,11,1,'selezione-i-classici-valpolicella-ca’d’or-750ml|Taxable Goods|750 ml|Selezione i Classici Valpolicella Ca’d’Or 750 ml|Il Valpollicella Ca’ d’Or sprigiona profumi delicati che ricordano le mandorle e la viola. Al palato riserva un gusto asciutto, morbido e di buona struttura.|Valpolicella Ca’d’Or Selezione I Classici|100|1'),(125,12,1,'selezione-noble-valpolicella-ripasso-superiore-cad’or-750ml|Taxable Goods|750 ml|Selezione Noble Valpolicella Ripasso Superiore Ca D’Or 750 ml|Il Ripasso della Valpollicella Ca’ d’Or maturato in rovere da 500/1000 lt per 18 mesi è un vino che si distingue per la particolare morbidezza e le note dolci e fruttate nascono da un sapiente blend.|Valpolicella Ripasso Superiore Ca D’Or Selezione Noble|100|1'),(126,13,1,'selezione-noble-amarone-nerofosco-cador-750ml|Taxable Goods|750 ml|Selezione Noble Amarone Nerofosco Ca D’Or 750 ml|L’Amarone Ca’ d’Or è un vino senza tempo. Maturato in legno per 30-36 mesi nasce opulento e di raffinata eleganza che infiamma il palato e lo sguardo con i suoi riflessi di rubino intenso.|Amarone Nerofosco Ca D’Or Selezione Noble|100|1'),(152,14,1,'durello-d.o.c.-750ml|Taxable Goods|750 ml|Durello D.O.C. 750 ml||Durello D.O.C. Santa Giulia|100|1'),(128,15,1,'durello-d.o.c.-1500ml|Taxable Goods|1500 ml|Durello D.O.C. 1500 ml||Durello D.O.C. Santa Giulia|100|1'),(129,16,1,'franciacorta-brut-d.o.c.g.-750ml|Taxable Goods|750 ml|Franciacorta Brut D.O.C.G. 750 ml||Franciacorta Brut D.O.C.G. Santa Giulia|100|1'),(130,17,1,'franciacorta-brut-d.o.c.g.-1500ml|Taxable Goods|1500 ml|Franciacorta Brut D.O.C.G. 1500 ml||Franciacorta Brut D.O.C.G. Santa Giulia|100|1'),(131,18,1,'franciacorta-satén-d.o.c.g.-750ml|Taxable Goods|750 ml|Franciacorta Satén D.O.C.G. 750 ml||Franciacorta Satén D.O.C.G. Santa Giulia|100|1'),(139,3,1,'selezione -grand-vintage-pas-dosé-riserva-750ml|Taxable Goods|750 ml|Selezione Grand Vintage Pas Dosé Riserva 750 ml|Nasce dai nostri vigneti Grand Cru coltivati ad uva Chardonnay e Pinot Nero. Dopo i 7 mesi per la prima fermentazione in piccole vasche di acciaio, per 48 mesi circa, riposa, matura e si affina rifermentando in bottiglia, a contatto con i lieviti selezionati, nell’oscurità e nel silenzio della Cantina.|Pas Dosé Riserva Selezione Grand Vintage Franciacorta D.O.C.G|100|1'),(122,9,1,'selezione-i-classici-soave-classico-ca’d’or-D.O.C.-750ml|Taxable Goods|750 ml|Selezione i Classici Soave Classico Ca’d’Or D.O.C. 750 ml|Il Soave Classico Ca’ d’Or è una ouverture perfetta di una calda serata di primavera che sfuma nella freschezza arborea delle sue note bucoliche.|Soave Classico Ca’d’Or D.O.C. Selezione I Classici|100|1'),(121,8,1,'selezione-vintage-blanc-de-blancs-millesimato-1500ml|Taxable Goods|1500 ml|Selezione Vintage Blanc de Blancs Millesimato 1500 ml|Nasce dai nostri vigneti Grand Cru coltivati ad uva Durella. Fermenta per circa 12 mesi in piccole vasche di acciaio, in totale assenza di solforosa, e si affina in bottiglia. E’ prodotto ogni anno con l’uva della stessa annata per cui, pur mantenendo le sue caratteristiche morbide, fresche e fruttate, ogni anno ci dona anche lievi differenti note aromatiche, perchè ogni stagione ha la sua nota distintiva.|Millessimato Selezione Vintage Lessini D.O.C. Metodo Charmat Lungo Blanc de Blancs|100|1'),(141,5,1,'selezione-grand-vintage-noble-rosé-1500ml|Taxable Goods|1500 ml|Selezione Grand Vintage Noble Rosé 1500 ml|Nasce dai nostri vigneti Grand Cru coltivati ad uva Pinot Nero e Chardonnay sulle dolci colline di Passirano. Dopo i 7 mesi per la prima fermentazione in piccole vasche di acciaio, per 30 mesi circa, riposa, matura e si affina rifermentando in bottiglia, a contatto con i lieviti selezionati, nell’oscurità e nel silenzio della Cantina.|Noble Rosé Selezione Grand Vintage Franciacorta D.O.C.G|100|1'),(119,6,1,'selezione-grand-vintage-franciacorta-satèn-750ml|Taxable Goods|750 ml|Selezione Grand Vintage Franciacorta Satèn 750 ml|Nasce dai vigneti posti sulle dolci colline di Ome, in provincia di Brescia, particolarmente esposta e ventilata, da uve Chardonnay. Dopo i 7 mesi per la prima fermentazione in piccole vasche di acciaio, per 30 mesi circa, riposa, matura e si affina rifermentando in bottiglia, a contatto con i lieviti selezionati, nell’oscurità e ne silenzio della Cantina.|Satèn Selezione Grand Vintage Franciacorta D.O.C.G|100|1'),(120,7,1,'selezione-vintage-blanc-de-blancs-millesimato-750ml|Taxable Goods|750 ml|Selezione Vintage Blanc de Blancs Millesimato 750 ml|Nasce dai nostri vigneti Grand Cru coltivati ad uva Durella. Fermenta per circa 12 mesi in piccole vasche di acciaio, in totale assenza di solforosa, e si affina in bottiglia. E’ prodotto ogni anno con l’uva della stessa annata per cui, pur mantenendo le sue caratteristiche morbide, fresche e fruttate, ogni anno ci dona anche lievi differenti note aromatiche, perchè ogni stagione ha la sua nota distintiva.|Millessimato Selezione Vintage Lessini D.O.C. Metodo Charmat Lungo Blanc de Blancs|100|1'),(140,4,1,'selezione-grand-vintage-noble-rosé-750ml|Taxable Goods|750 ml|Selezione Grand Vintage Noble Rosé 750 ml|Nasce dai nostri vigneti Grand Cru coltivati ad uva Pinot Nero e Chardonnay sulle dolci colline di Passirano. Dopo i 7 mesi per la prima fermentazione in piccole vasche di acciaio, per 30 mesi circa, riposa, matura e si affina rifermentando in bottiglia, a contatto con i lieviti selezionati, nell’oscurità e nel silenzio della Cantina.|Noble Rosé Selezione Grand Vintage Franciacorta D.O.C.G|100|1'),(150,1,1,'selezione-grand-vintage-noble