INSERT INTO `core_email_template` VALUES (1,'Customer Care','Nome: {{var data.name}}\r\nCognome: {{var data.cognome}}\r\nEmail: {{var data.email}}\r\nRechiesta: {{var data.richiesta}}\r\nTelephone: {{var data.telephone}}\r\n\r\nMessaggio: {{var data.comment}}',NULL,1,'Customer Care Form',NULL,NULL,'2018-04-11 01:43:07','2018-04-11 05:57:48','contacts_email_email_template','{\"var data.name\":\"Sender Name\",\"var data.email\":\"Sender Email\",\"var data.telephone\":\"Sender Telephone\",\"var data.comment\":\"Comment\"}'),(2,'Club Cador','{{template config_path=\"design/email/header\"}}\r\n{{inlinecss file=\"email-inline.css\"}}\r\n\r\n<table cellpadding=\"0\" cellspacing=\"0\" border=\"0\">\r\n    <tr>\r\n        <td class=\"action-content\">\r\n            <h1>Benvenuto su {{var store.getFrontendName()}}.</h1>\r\n            <p>Per accedere, quando visiti il nostro sito, basta cliccare su <a href=\"{{store url=\"club-cador\"}}\">Login</a> o <a href=\"{{store url=\"club-cador\"}}\">Il mio Account</a> in alto in ogni pagina, poi inserire il tuo indirizzo e-mail e la tua password.</p>\r\n            <p class=\"highlighted-text\">\r\n               Usa i seguenti dati per fare il login:<br/>\r\n                <strong>Email</strong>: {{var data.email}}<br/>\r\n                <strong>Password</strong>: {{htmlescape var=$data.password}}<br/>\r\n                <strong>Date of birthday</strong>: {{var data.dob}}<br/>\r\n                <strong>Telephone</strong>: {{var data.telephone}}<br/>\r\n                <strong>Postcode</strong>: {{var data.postcode}}<br/>\r\n                <strong>City</strong>: {{var data.city}}<br/>\r\n                <strong>Street</strong>: {{var data.street_name}}<br/>\r\n                <strong>Country</strong>: {{var data.country_name}}\r\n            </p>\r\n            <p>Quando avrai effettuato l\'accesso al tuo account, sarai ini grado di:</p>\r\n            <ul>\r\n                <li>Passare attraverso checkout pi&ugrave; veloci quando effettui un acquisto</li>\r\n                <li>Verificare lo stato degli ordini</li>\r\n                <li>Visualizzare gli ordini precedenti</li>\r\n                <li>Modificare le informazioni relative al tuo account</li>\r\n                <li>Cambiare la tua password</li>\r\n                <li>Memorizzare indirizzi alternativi (per spedire a pi&ugrave; membri della famiglia ed agli amici!)</li>\r\n            </ul>\r\n            <p>\r\n                            Se hai qualche domanda contattaci al nostro indirizzo email\r\n                            <a href=\"mailto:{{var store_email}}\">{{var store_email}}</a>\r\n                            {{depend store_phone}} oppure al nostro numero <a href=\"tel:{{var phone}}\">{{var store_phone}}</a>{{/depend}}.\r\n                        </p>\r\n        </td>\r\n    </tr>\r\n</table>\r\n\r\n{{template config_path=\"design/email/footer\"}}',NULL,2,'Benvenuto, {{var customer.name}}!',NULL,NULL,'2018-04-12 01:36:41','2018-04-12 07:13:49','customer_create_account_email_template','{\"store url=\\\"\\\"\":\"Store Url\",\"var logo_url\":\"Email Logo Image Url\",\"htmlescape var=$customer.name\":\"Customer Name\",\"store url=\\\"customer/account/\\\"\":\"Customer Account Url\",\"var customer.email\":\"Customer Email\",\"htmlescape var=$customer.password\":\"Customer Password\"}'),(3,'Club Cador Login','{{template config_path=\"design/email/header\"}}\r\n{{inlinecss file=\"email-inline.css\"}}\r\n\r\n<table cellpadding=\"0\" cellspacing=\"0\" border=\"0\">\r\n    <tr>\r\n        <td class=\"action-content\">\r\n            <p class=\"highlighted-text\">\r\n                Use the following values when prompted to log in:<br/>\r\n                <strong>Email</strong>: {{var datalogin.email}}<br/>\r\n                <strong>Password</strong>: {{htmlescape var=$datalogin.password}}<br/>\r\n                <strong>Customer Name</strong>: {{var datalogin.name}}<br/>\r\n                <strong>Date of birthday</strong>: {{var datalogin.dob}}<br/>\r\n                <strong>Telephone</strong>: {{var datalogin.telephone}}<br/>\r\n                <strong>Postcode</strong>: {{var datalogin.postcode}}<br/>\r\n                <strong>City</strong>: {{var datalogin.city}}<br/>\r\n                <strong>Street</strong>: {{var datalogin.street_name}}<br/>\r\n                <strong>Country</strong>: {{var datalogin.country_name}}\r\n            </p>\r\n        </td>\r\n    </tr>\r\n</table>\r\n\r\n{{template config_path=\"design/email/footer\"}}',NULL,2,'Information Customer Login!',NULL,NULL,'2018-04-13 00:59:30','2018-04-13 02:18:04','customer_create_account_email_template','{\"store url=\\\"\\\"\":\"Store Url\",\"var logo_url\":\"Email Logo Image Url\",\"htmlescape var=$customer.name\":\"Customer Name\",\"store url=\\\"customer/account/\\\"\":\"Customer Account Url\",\"var customer.email\":\"Customer Email\",\"htmlescape var=$customer.password\":\"Customer Password\"}');
